import { Button } from '@material-ui/core'

function changeStartState() {
    console.log("Pressed");
    setStart(true)
    console.log(startState);
}

class StartButton extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
          startState: false,
        }
      }

    render() {
        return (
            <div>
                <Button variant="contained" color="primary" onClick={() => changeStartState()}> Start </Button>
            </div>
        )
    }

}

export default StartButton;
